 // Init
 'use strict';
 var app = angular.module('app',
     [
         'ngRoute',
         'ngAnimate',
         'ngCookies',
         'angular-loading-bar',
         'ngResource',
         'ngMask',
         'ngAria',
         'ngDialog',
         'ngMaterial',
         'ngDialog',
         'ngCpfCnpj',
         'datePicker',
         'satellizer',
         'ngCurrencyMask',
         'google.places',
         'ngTinyScrollbar',
         'angular-movmovit-map'
     ]);
 
 app.directive('iconFill', function () {
     return {
         restrict: 'A',
         link: function(scope, element, attr) {
             var object = angular.element(element[0].children[0]);
             /** @namespace attr.iconFill */
             if(angular.isDefined(attr.iconFill)) {
                 object.load(function () {
                     var svg = angular.element(this.getSVGDocument().documentElement);
                     svg.attr('fill', attr.iconFill);
                 });
             }
         }
     };
 });

 app.config([
     'ngDialogProvider',
     '$maskerProvider',
     function (
         ngDialogProvider,
         $maskerProvider
     ) {
     ngDialogProvider.setDefaults({
         className: 'ngdialog-theme-default dialog',
         showClose: true,
         closeByDocument: true,
         closeByEscape: true
     });
 
     $maskerProvider.setCurrency('BRL');
 
     // Auth
     //$authProvider.loginUrl = '/auth/login';
 
 }]);
 app.constant("myConfig", {
     "url": "http://localhost",
     "port": "80",
     "paths": {
         'pages' : './pages/',
         'modules' : './modules/',
         'shared' : './shared/'
     }
 });
 
 app.run(function ($rootScope, $timeout, $cookies, ngDialog) {
 
     $rootScope.page = {
         setTitle: function (title) {
             this.title = ' - ' + title;
         }
     };
 
     $rootScope.bodyClass = {
         setClass: function (title) {
             this.name = title;
         }
     };
 
     $rootScope.$on('$routeChangeSuccess', function (event, current, previous) {
         $rootScope.page.setTitle(current.$$route.title || 'Default Title');
     });
 });
 

 app.config(function ($routeProvider, $locationProvider) {
     var appRoutes = {
         components: "pages/"
     };
     $locationProvider.html5Mode({
         enabled: false,
         requireBase: false
     });
     $routeProvider
         .when('/', {
             title: 'Login',
             templateUrl: appRoutes.components + 'login/login.html',
             controller: "loginController"
         })
         .when('/pagina-nao-encontra', {
             title: 'Pagina no encontrada',
             templateUrl: appRoutes.components + 'not-found/not-found.html'
         })
         .when('/pedidos', {
             title: 'Pedidos',
             templateUrl: appRoutes.components + 'order/order-list.html',
             controller: "orderController"
         })
         .otherwise({
             redirectTo: '/pagina-nao-encontra'
         });
 })
 
     .run(function ($rootScope) {
         $rootScope.hasAuth = true;
     });


 // Controllers
 app.controller('loginController',
     [
         '$scope',
         '$rootScope',
         '$http',
         '$timeout',
         '$location',
         '$auth',
         function (
             $scope,
             $rootScope,
             $http,
             $timeout,
             $location,
             $auth
         ) {
             $scope.pageInfo = [
                 {
                     "title": "Login"
                 }
             ];
             $rootScope.isAuthenticated = function () {
                 return $auth.isAuthenticated();
             };
 
             $scope.busy = false;
 
             $scope.auth = function () {
 
                 window.location = "#/pedidos";
                 $scope.busy = true;
                 $auth.login($scope.user);
                 $timeout(function () {
                     console.log($auth.isAuthenticated());
                     $scope.busy = false;
                 }, 2000);
                 //$location.url('/pedidos');
             };
 
             $scope.logout = function () {
                 $auth.logout();
             };
 
             $scope.isForgotPass = false;
             $scope.forgotPassword = function () {
                 $scope.isForgotPass = true;
             };
 
             $scope.sendPassword = function () {
                 $scope.busy = true;
                 //$scope.sendSuccess = true;
             };
 
             $scope.backLogin = function () {
                 $scope.isForgotPass = false;
             }
         }]);

 app.controller('headerController', ['$scope', '$rootScope', '$http', '$timeout', 'ngDialog', '$location',
     function($scope, $rootScope, $http, $timeout, ngDialog, $location) {
         $scope.isVisible = false;
         $scope.displayFilter = function() {
             $scope.isVisible = (!$scope.isVisible) ? true : false;
         };
         $scope.isSelectOpened = false;
         $scope.showSelectBox = function() {
             $scope.isSelectOpened = $scope.isSelectOpened ? false : true;
             $scope.showOptions = false;
         };
         $scope.showOptions = false;
         $scope.openedOptions = function() {
             $scope.showOptions = $scope.showOptions ? false : true;
         };
         $scope.showCalendar = false;
         $scope.textOption = 'Ultima semana';
         $scope.idSelect = 'lastWeek';
         $scope.selectDate = function($id) {
             var $element = angular.element('#' + $id),
                 $clone = $element.clone();
             $scope.textOption = $element.text();
             $scope.showCalendar = ($id == 'date') ? true : false;
             $scope.idSelect = $id;
         };
         $scope.dateRange = '';
     }
 ]);

 app.controller('orderController', ['$scope', '$rootScope', '$http', '$timeout', 'ngDialog', '$location', '$window', 'myConfig', '$interval',
     function($scope, $rootScope, $http, $timeout, ngDialog, $location, $window, myConfig, $interval) {
         $scope.showMap = true;
         $scope.pageInfo = [{
             "title": "Pedidos"
         }];
         $scope.showDialog = function($page) {
             $scope.insidePage = $page;
             ngDialog.open({
                 template: myConfig.paths.pages + 'order/order-scene.html',
                 className: 'wrapper-modal order-scene ' + $page,
                 scope: $scope
             });
         };
         $scope.displayList = function (act){
             $scope.showMap = act == 'map' ? true : false;
             $scope.modalBusy = true;
             $timeout(function(){
                 $scope.modalBusy = false;
             }, 1000);
         };
 
         $scope.newOrderRequest = function() {
             ngDialog.open({
                 template: myConfig.paths.pages + 'order/order-new-request.html',
                 className: 'wrapper-modal order-new-request'
             });
         };
         $scope.includePage = function() {
             return myConfig.paths.pages + 'order/' + $scope.insidePage + '.html';
         };
         $scope.hideShadow = false;
         $scope.callDriver = function($driverID) {
             $scope.callingDriver = true;
         }
     }
 ]);

